import React, { Component } from "react";

// MUI
import Grid from "@material-ui/core/Grid";
import TextField from "@material-ui/core/TextField";

class login extends Component {
  render() {
    return (
      <div style={{ margin: "auto" }}>
        <Grid container>
          <Grid item>
            <TextField
              id="outlined-basic"
              label="Username"
              variant="outlined"
            />
          </Grid>
          <Grid item>
            <TextField
              id="outlined-basic"
              label="Password"
              variant="outlined"
            />
          </Grid>
          <Grid item>
            <p>Button</p>
          </Grid>
        </Grid>
      </div>
    );
  }
}

export default login;
